import React from 'react'
import {BrowserRouter, Routes, Route} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path = "/register" element = {<Register />}/>
      <Route path = "/loginr" element = {<Login />}/>
      <Route path = "/" element = {<Chat />}/>
    </Routes>
    </BrowserRouter>
  )
}

export default App
